//import { Link } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css'
//import { Container } from 'react-bootstrap'
import SideNav from '../components/sidenav';


function DashPage() {
    const navStatus = {
        active1: true,
        active2: false,
    };
    return(
    <div>
        <SideNav actives={navStatus}/>
    </div>
    );
}

export default DashPage;
